import React from "react"
import styles from "./Navbar.module.css"

import topdeals from "./Extras/Topdeals.webp"

export class Navbar extends React.Component{
constructor(){
super()
}

render(){
return(

<div className={styles.Navbar}>

<ul>
<li>
<button>
<img src={topdeals} />
<p> Top Deals </p>
</button>
</li>
</ul>

</div>
)
}

}
